export const HEADERLINKS = {
  ABOUTME: {
    value: "aboutMe",
    link: "/about-me"
  },
  EXPERIENCE: {
    value: "Experience",
    link: "/experience"
  },
  SKILLS: {
    value: "Skills",
    link: "/skills"
  },
  PROJECTS: {
    value: "Projects",
    link: "/projects"
  },
  BLOGS: {
    value: "Blogs",
    link: "/blog"
  }
}
const Header = ({active = HEADERLINKS.ABOUTME}) => {
  return (
    <div className="header-wrapper">
      <ul className="header__links">
        {
          Object.values(HEADERLINKS).map((value) => (
            <li className={value.value === active.value && 'active'}>{value.value}</li>
          ))
        }
      </ul>
    </div>
  )
}


export default Header
